SELECT COUNT(*) as agg_0, MAX("lineorder"."lo_extendedprice") as agg_1 FROM "part" LEFT OUTER JOIN "lineorder" ON "part"."p_partkey" = "lineorder"."lo_partkey" LEFT OUTER JOIN "customer" ON "lineorder"."lo_custkey" = "customer"."c_custkey" LEFT OUTER JOIN "supplier" ON "lineorder"."lo_suppkey" = "supplier"."s_suppkey"  WHERE "lineorder"."lo_orderpriority" NOT LIKE '%1-URGENT%' AND "customer"."c_city" = 'FRANCE   7' AND "part"."p_color" = 'misty' AND "part"."p_container" LIKE '%CA%N%' AND ("customer"."c_city" LIKE '%MOROCCO%' OR "customer"."c_city" IN ('MOZAMBIQU8', 'ROMANIA  4', 'MOROCCO  8', 'FRANCE   5', 'UNITED ST6') OR "customer"."c_city" NOT LIKE '%U%NITED%') AND "supplier"."s_city" LIKE '%MOROCCO%'